import { TypeAnimation } from "react-type-animation";
import "./Home.css";

export function Home() {
  const typingDelay: number = 1000;
  const typingTexts: string[] = [
    "likes to try new food",
    "likes problem solving",
    "is an App Developer at the University of Exeter",
    "loves the gym!",
    "is looking for new opportunities",
    "wants to get into Machine Learning",
    "loves to draw",

  ];

  return (
    <div className="home-page flex">
      <div className="intro-info">
        <div className="title plax">
          I'm <span>Gowtham</span>
          <span className="title-span">.</span>
        </div>
        <div className="title-text plax">
          A programmer who <span className="typed-text"> </span>
          {/* <span className="wrap">{typingText}</span> */}
          <TypeAnimation
            sequence={[
              "likes to try new food",
              typingDelay,
              "likes problem solving",
              typingDelay,
              "is an App Developer at the University of Exeter",
              typingDelay,
              "loves the gym!",
              typingDelay,
              "is looking for new opportunities",
              typingDelay,
              "wants to get into Machine Learning",
              typingDelay,
              "loves to draw",
              typingDelay,
            ]}
            wrapper="div"
            cursor={true}
            repeat={Infinity}
            style={{ fontSize: "2em" }}
            speed={1}
          />
        </div>
      </div>
    </div>
  );
}
